import React from "react";
import {createAppContainer, createStackNavigator} from "react-navigation";
//import MainScreen from "../screen/main/MainScreen";
import PaintScreen from "../screen/main/new_painting/PaintScreen";
import PaintAnimalScreen from "../screen/main/new_painting/paint/PaintAnimalScreen";
import PaintedListScreen from "../screen/main/new_painting/paint/PaintedListScreen";
import LetPaintScreen from "../screen/main/new_painting/painting/LetPaintingScreen";
import LetPaintedScreen from "../screen/main/new_painting/painting/LetPaintedScreen";
import AikaScreen from "../screen/main/AikaScreen";
import MainScreen from "../screen/main/MainScreen";
import QuizDetailScreen from "../screen/main/QuizDetailScreen";
import VideoScreen from "../screen/main/VideoScreen";
import VideoListsScreen from "../screen/main/VideoListsScreen";
import QuizIndexScreen from "../screen/main/QuizIndexScreen";
import QuizAppScreen from "../screen/main/QuizAppScreen";


const AppRouter = createStackNavigator({
    Aika: {
        screen: AikaScreen,
    },
    Main: {
        screen: MainScreen,
    },
    Quiz: {
        screen: QuizDetailScreen,
    },
    QuizIndex: {
        screen: QuizIndexScreen,
    },
    QuizApp: {
        screen: QuizAppScreen,
        navigationOptions: {
            // header: null
            headerTitle: "Quizz Application"
           }
    },
    VideoScreen: {
        screen: VideoScreen,
    },
    VideoLists: {
        screen: VideoListsScreen,
    },
    Paint: {
        screen: PaintScreen,
    },
    PaintAnimals: {
        screen: PaintAnimalScreen,
    },
    PaintedList: {
        screen: PaintedListScreen,
    },
    LetPaint: {
        screen: LetPaintScreen,
    },
    LetPainted: {
        screen: LetPaintedScreen,
    }
}, {
    headerMode: 'none',
    initialRouteName: 'Main'
});

export const AppContainer = createAppContainer(AppRouter);
